import PropTypes from 'prop-types'
import { useParams, Link } from 'react-router-dom'

const User = ({user}) => {
    const userId = useParams().userId
    return (
        <div>
            <Link to={`/user/${userId}`}>{user.username}</Link> {user.blogs.length}
        </div>
    )
}

User.propTypes = {
    user: PropTypes.object
}

export default User
